import React, { useState } from 'react';

export default function InvoiceCartReview({ cart, setTab }) {
  const [invoiceData, setInvoiceData] = useState(
    cart.map(item => ({
      name: item.name,
      batch: item.entries[0].batch,
      mfg: item.entries[0].mfg,
      exp: item.entries[0].exp,
      qty: item.entries[0].qty,
     // ctn: item.entries[0].ctn,
      billedQty: item.entries[0].qty,
      discount: 0,
    }))
  );

  const handleChange = (index, field, value) => {
    const newData = [...invoiceData];
    newData[index][field] = value;
    setInvoiceData(newData);
  };

  const grandTotal = invoiceData.reduce((sum, item) => {
    const qty = parseFloat(item.billedQty) || 0;
    const discount = parseFloat(item.discount) || 0;
    return sum + (qty * (1 - discount / 100));
  }, 0);

  return (
    <div className="max-w-4xl mx-auto p-6 space-y-4">
      <h2 className="text-xl font-bold text-center mb-6">🧾 Invoice Generation</h2>

      <div className="overflow-x-auto">
        <table className="min-w-full text-sm border">
          <thead>
            <tr className="bg-gray-100">
              <th className="border p-2">Item</th>
              <th className="border p-2">Batch</th>
              <th className="border p-2">MFG</th>
              <th className="border p-2">EXP</th>
              <th className="border p-2">Qty</th>
              <th className="border p-2">CTN</th>
              <th className="border p-2">Billed Qty</th>
              <th className="border p-2">Discount (%)</th>
              <th className="border p-2">Total</th>
            </tr>
          </thead>
          <tbody>
            {invoiceData.map((item, i) => (
              <tr key={i}>
                <td className="border p-2">{item.name}</td>
                <td className="border p-2">{item.batch}</td>
                <td className="border p-2">{item.mfg}</td>
                <td className="border p-2">{item.exp}</td>
                <td className="border p-2">{item.qty}</td>
                <td className="border p-2">{item.ctn}</td>
                <td className="border p-2">
                  <input
                    type="number"
                    value={item.billedQty}
                    onChange={(e) => handleChange(i, 'billedQty', e.target.value)}
                    className="w-16 border rounded px-2 py-1"
                  />
                </td>
                <td className="border p-2">
                  <input
                    type="number"
                    value={item.discount}
                    onChange={(e) => handleChange(i, 'discount', e.target.value)}
                    className="w-16 border rounded px-2 py-1"
                  />
                </td>
                <td className="border p-2 font-bold text-green-700">
                  {(parseFloat(item.billedQty || 0) * (1 - (item.discount || 0) / 100)).toFixed(2)}
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>

      <div className="text-right font-bold text-xl mt-6">
        Grand Total: ₹ {grandTotal.toFixed(2)}
      </div>

      <div className="flex justify-center mt-6">
        <button
          onClick={() => setTab("categories")}
          className="bg-blue-500 hover:bg-blue-600 text-white px-6 py-3 rounded-lg shadow"
        >
          🔙 Back to Items
        </button>
      </div>
    </div>
  );
}
